import React from 'react';
import './Navbar.css';

const Nav = () => {
    return (
        <nav className='nav'>
            <div class><a>Profile</a></div>
            <div><a>Messages</a></div>
            <div><a>News</a></div>
            <div><a>Music</a></div>
            <div><a>Settings</a></div>
        </nav>
    )
}

export default Nav;
